import React from "react";

function MainWindow(){
    return(
        <div className="MainWindow">  
        <div className="MW1">
        <div className="COL1">
            <div className="A1 LOGO">LOGO</div>
            <div className="B1">SZUKAJ</div>
        </div>

        <div className="COL2">
            <div className="A2">
                <a href="">HOME</a>
            </div>
            <div className="B2">OKNO</div>
        </div>
        </div>
        </div>
    )
}



export default MainWindow;
